import React, { Component } from 'react';
import 'semantic-ui-css/semantic.min.css';
import {
  Image,
  Button,
  Card
} from 'semantic-ui-react'

class Items extends Component {

  state = {hovered: false};

  onEnter = () => {
    this.setState({hovered: true});
  }

  onExit = () => {
    this.setState({hovered: false});
  }


  render() {
    return (
      <div>
          <h2>Items</h2>
    </div>
    );
  }
}

export default Items;
